package block

import (
	"encoding/hex"
	"encoding/json"
	"testing"

	"github.com/consensys/gnark-crypto/ecc"
	"github.com/consensys/gnark/backend"
	"github.com/consensys/gnark/frontend"
	"github.com/consensys/gnark/test"

	"github.com/bnb-chain/zkbnb-crypto/legend/circuit/bn254/std"
)

func TestVerifyBlock_Transfer(t *testing.T) {
	blockInfoBytesHex := ""
	blockInfoBytes, err := hex.DecodeString(blockInfoBytesHex)
	if err != nil {
		t.Fatal(err)
	}

	var oBlock *Block
	err = json.Unmarshal([]byte(blockInfoBytes), &oBlock)
	if err != nil {
		panic(err)
	}
	assert := test.NewAssert(t)
	var circuit, witness BlockConstraints
	circuit, err = SetBlockWitness(oBlock)
	if err != nil {
		t.Fatal(err)
	}
	witness, err = SetBlockWitness(oBlock)
	if err != nil {
		t.Fatal(err)
	}
	assert.SolvingSucceeded(
		&circuit, &witness, test.WithBackends(backend.GROTH16),
		test.WithCurves(ecc.BN254),
		test.WithProverOpts(backend.WithHints(std.Keccak256, std.ComputeSLp)),
		test.WithCompileOpts(frontend.IgnoreUnconstrainedInputs()))
}
